const CakeForm = () => {
    return ( 
        <section>
            <form>
                <label htmlFor="cake-name" />
                <input type="text" id="cake-name" />
                <label htmlFor="cake-ingredient" />
                <input type="text" id="cake-ingredient" />
                <label htmlFor="cake-price" />
                <input type="text" id="cake-price" />
                <label htmlFor="cake-rating" />
                <input type="text" id="cake-rating" />
            </form>
        </section>
     );
}

export default CakeForm;
